import React, {
    Component,
    Children
} from 'react';
import {
    array
} from 'prop-types';
import {
    forEachChild
} from 'typescript';

class FetchConnectApi extends Component {
    constructor(props) {
        super(props)
        this.state = {
            jsonData: []
        }
    }

    myfunction(resposeData) {
        var objData = JSON.parse(this.state.jsonData);

        return 0;
    }
    componentDidMount() {
        fetch('https://www.reddit.com/r/nonbinary.json')
            .then(jsonData => {
                if (!jsonData.ok) {
                    throw Error("Network request failed")
                }
                return jsonData;
            })
            .then(data => data.json())
            .then(data =>
                    this.setState({
                    jsonData: data.data
                }));
    }

f_test(){
    if(typeof this.state.jsonData !== "undefined"){
        if(typeof this.state.jsonData.children.data !== "undefined"){
            const x = this.state.jsonData.data;
            return JSON.stringify(x);
        }
    }
    return 0;
    
}
    render() {
        if (this.state.requestFailed) return <p> Failed! </p>
        if (!this.state.results) 
            return <p>
            {this.f_test()}

                success</p>
    }
}
export default FetchConnectApi;
